DROP TABLE IF EXISTS cishfid.organisation_type;

DROP SEQUENCE IF EXISTS cishfid.organisation_type_id_seq;

CREATE SEQUENCE IF NOT EXISTS cishfid.organisation_type_id_seq
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 250;

create table cishfid.organisation_type
(
    id bigint NOT NULL,
    stm_tp_cd       text,
    cmpny_tp_cd     integer,
    src_tbl_no      text,
    src_tbl_nme     text,
    src_cat         text,
    org_src_tp_cd   text,
    org_src_tp_desc text,
    tbl_nme         text,
    org_entps_tp_cd integer,
    org_tp_desc     text,
    org_cat_tp_cd	  integer,
    org_tp_efctv_dt text,
    org_tp_expry_dt text,
    CONSTRAINT organisation_type_pkey PRIMARY KEY(id)
);

commit;